const List = () => {
  const[listItem, setListItem]=  useState([]);
  // const API = 'http://www.songsterr.com/a/ra/songs';

  useEffect(()=>{
    window
      .fetch("http://www.songsterr.com/a/wa/artist?id={1}")
      .then((response) => response.json())
      .then(console.log);
  },[])

  return (
    <div>
      hola
    </div>
  );
};

export default List;
